        #region Delete From Table
        static bool DelFromTable(List<string> lst)
        {
            if (string.IsNullOrWhiteSpace(string.Concat(lst)))//không có query
                return true;
            return ExecuteMulti(ref _userError, ref _systemError, lst.Where(x => !string.IsNullOrWhiteSpace(x))
                                                                 .Select(x => string.Format("DELETE FROM {0}", _user + "." + x)).ToList());
        }
        #endregion

