        static bool Exist(string owner, string name, string type) //chưa tối ưu vì gán UserMMYY thay vì schema
        {
            string L = "";
            if (type == "TABLE")
            {
                L = @"N'U'";
            }
            else if (type == "TRIGGER" || type == "FUNCTION" || type == "SEQUENCE")
            {
                L = @"  N'FN', N'IF', N'TF', N'FS', N'FT'"; 
            }
            var sql = string.Format(@"


SELECT * FROM sys.objects 
                                    WHERE 
                                         UPPER(Name) = N'{1}'
                                        AND Type IN ({2})"
                        , owner.ToUpper()
                        , name.ToUpper()
                        , L.ToUpper());
            XL_BANG.GhiCauLenh("USE [" + owner.ToUpper() + "]");
            using (DataTable dt = XL_BANG.Doc(sql))
            {
                return (dt != null && dt.Rows.Count > 0);
            }
        }
